import React, {Component} from 'react';

const rightsidebar = ({likecontent,galleryimages,trendsdata}) =>{
  const style = {
    display:"flex",
    flexDirection: "row"  
  };
  return(
    <div class="rightcolumn">
      <div className="searchForm">
          <form>
            <input
              placeholder="Search for..."value="search"/>
            <button type="submit" value="Enter"><i class="fa fa-search">Enter</i></button>
          </form>
      </div>

      <div  className="card grid-container" >
          {
            galleryimages.map(item => (
              <div style={{margin:"5px"}} className>
                  <span ><img src = {item.image} alt=""/></span>
              </div>
              ))
          }    
      </div>
      <div  className="card">
          {
            likecontent.map(item => (
              <div >
                    <div class="fakeimg"><p><img src={item.image}/>     {item.name}<br/>{item.tweetid}</p></div>      
              </div>
              ))
          }    
      </div>
      <div  className="card">
          {
            trendsdata.map(item => (
              <div >
                    <div class="fakeimg">
                      <span>Trending in {item.countryname}<br/>    #{item.name}<br/>{item.count}</span></div>      
              </div>
              ))
          }    
      </div>

    </div>
  );
}
export default rightsidebar
